import React from 'react';

function Admindash({ flights, bookFlight, cancelFlight, rescheduleFlight }) {
  return (
    <div>
      <h2>Flights</h2>
      <ul>
        {flights.map((flight) => (
          <li key={flight.id}>
            <div>{flight.name}</div>
            <div>{flight.status}</div>
            <div>
              {flight.status === 'booked' && (
                <button onClick={() => cancelFlight(flight)}>Cancel</button>
              )}
              {flight.status === 'booked' && (
                <button onClick={() => rescheduleFlight(flight)}>
                  Reschedule
                </button>
              )}
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Admindash;
